    Robert obtained from a financial institution and in turn loaned the money to Janet
    Robert for Congress.  Due to a lack of software capabilities the details of the
    loan are unable to be transmitted in Schedule C1 and therefore will be disclosed
    as follows:  The lender is Southwest Bank - 700 Corporate Park Dr., Clayton, MO  63105.  The
    loan amount was $750,000, which occurred on 8/19/02 and is due on 6/18/03 at an
    interest rate of 4.75%.  The collateral for the loan was stock valued at $1,142,457.  The
    lender does have a perfected security interest and there are no future contributions
    or future receipts of interest income, pledged as collateral for the loan.  No
